  false,\n\t\"url\": null,\n\t\"notes\": \"Bottle, CTD, and XBT data were collected
  in the Arctic, North Atlantic, North Pacific Oceans from the JOHN P. TULLY and other
  platforms from 14 July 1961 to 02 January 2001. Data include temperature and salinity
  profiles. Data also include concentration profiles of chlorophyll a, oxygen, nitrate,
  nitrite, phosphate, and silicate. Data were submitted by the Marine Environmental
  Data Service (MEDS) of Canada and are in the MEDS ASCII format.\",\n\t\"owner_org\":
